import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTachometerAlt, faUser, faBroadcastTower, faBell, faChartBar, faVideo } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from 'react-router-dom';

const Sidebar = () => {
  const navigate = useNavigate();

  const navigateTo = (path) => {
    navigate(path);
  };

  return (
    <aside className="w-64 bg-gray-50 min-h-screen p-5">
      <div className="flex items-center justify-center">
        <FontAwesomeIcon icon={faVideo} className="h-8 w-8 text-gray-600 mb-8" />
      </div>
      <nav className="mt-10">
        {/* Additional links here */}
        <a onClick={() => navigateTo('/dashboard')} className="flex items-center p-2 my-2 transition-colors duration-200 justify-start text-gray-600 hover:text-gray-700">
          <FontAwesomeIcon icon={faTachometerAlt} className="w-5 h-5" />
          <span className="mx-4 text-sm font-normal">Dashboard</span>
        </a>
        {/* ... other sidebar links ... */}
      </nav>
    </aside>
  );
};

export default Sidebar;
